-- Ensure the Project table exists with a ProjectID column
IF NOT EXISTS (SELECT * FROM sys.tables WHERE name = 'Projects')
BEGIN
    CREATE TABLE Projects (
        ProjectID INTEGER PRIMARY KEY
        -- Add other columns as needed
    );
END;

-- Ensure the Contractor table exists with a ContractorID column
IF NOT EXISTS (SELECT * FROM sys.tables WHERE name = 'Contractor')
BEGIN
    CREATE TABLE Contractor (
        ContractorID INTEGER PRIMARY KEY,
        ContractorName VARCHAR(50) NOT NULL
    );
END;

-- Ensure the Contract table exists with ContractorID and ProjectID columns
IF NOT EXISTS (SELECT * FROM sys.tables WHERE name = 'Contract')
BEGIN
    CREATE TABLE Contract (
        ContractID INTEGER PRIMARY KEY,
        ContractorID INTEGER,
        ProjectID INTEGER,
        -- Add other columns as needed
        FOREIGN KEY (ContractorID) REFERENCES Contractor(ContractorID),
        FOREIGN KEY (ProjectID) REFERENCES Projects(ProjectID)
    );
END;



-- ContractWin
DROP TABLE IF EXISTS ContractWin;

-- Create the ContractWin table with a new primary key column
CREATE TABLE ContractWin (
   ContractWinID INT PRIMARY KEY IDENTITY(1,1), -- New unique identity column
   ContractWin VARCHAR(5) NOT NULL,
   WinnerID INTEGER NOT NULL,
   WinDate DATE NOT NULL
);

