-- IF OBJECT_ID('dbo.Subcontractor', 'U') IS NOT NULL
-- BEGIN
--     -- Add foreign key constraint if the Subcontractor table exists
--     ALTER TABLE Subcontractor
--     ADD CONSTRAINT FK_Subcontractor_Contractor 
--     FOREIGN KEY (ContractorID) 
--     REFERENCES Contractor(ContractorID);
-- END;

IF NOT EXISTS (
    SELECT * 
    FROM sys.foreign_keys 
    WHERE name = 'FK_Subcontractor_Contractor'
)
BEGIN
    ALTER TABLE Subcontractor
    ADD CONSTRAINT FK_Subcontractor_Contractor 
    FOREIGN KEY (ContractorID) 
    REFERENCES Contractor(ContractorID);
END;


